import { useState } from "react";

const Header = () => {
  return (
    <div>
      <h2>Give feedback</h2>
      <button>good</button>
      <button>neutral</button>
      <button>bad</button>
    </div>
  );
};

const Statistics = () => {
  return (
    <div>
      <h2>Statistics</h2>
      <p>good: </p>
      <p>neutral: </p>
      <p>bad: </p>
    </div>
  );
};

const App = () => {
  // save clicks of each button to its own state
  const [good, setGood] = useState(0);
  const [neutral, setNeutral] = useState(0);
  const [bad, setBad] = useState(0);

  return (
    <div>
      <Header />
      <Statistics />
    </div>
  );
};

export default App;
